        public int Calculate(float[] input, out float BestPct)
        {
            float[] Layer0Out = new float[Layer0B.Length];
            MLUtils.CalcNetworkLayer(input, Layer0Out, Layer0W, Layer0B);
            MLUtils.ApplyRelu(Layer0Out);
            
            float[] Layer1Out = new float[Layer1B.Length];
            MLUtils.CalcNetworkLayer(Layer0Out, Layer1Out, Layer1W, Layer1B);
            MLUtils.ApplySoftmax(Layer1Out);

            return MLUtils.PickHighestProbability(Layer1Out, out BestPct);
        }

        public int CalculateType(float[] input, out float BestPct)
        {
            float[] Layer0Out = new float[LayerT0B.Length];
            MLUtils.CalcNetworkLayer(input, Layer0Out, LayerT0W, LayerT0B);
            MLUtils.ApplySoftmax(Layer0Out);

            return MLUtils.PickHighestProbability(Layer0Out, out BestPct);
        }

